import React from "react";
import './styles.css';

const About=()=>{
    return (
        <div>
            <div class="main" id="about">
                <div class="main__container">
                    <div class="main__content">
                        <h1>About</h1>
                        <h2>Who Am I?</h2>
                        <p>I am currently a sophomore at Boston University and majoring in Computer Science.</p>
                        <button class="main__btn"><a href="./contact.html">Contact Me</a></button>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default About;
